import React from 'react';

import './Overview.css'


function Overview() {
    return (
        <div>
            <hr size="2" id="overview"/>
            <div className="presentation" id="overviewPresentation">
                <div className="text">
                    <p className="p1">
                        Esta pesquisa de opinião foi desenvolvida por estudantes e para estudantes, com o objetivo de dar
                        voz à comunidade acadêmica de graduação, que raramente tem seus anseios e opiniões ouvidos. Nós
                        esperamos que esta seja a primeira de muitas e que vocês encontrem aqui um ambiente de representatividade.
                        Ao longo do desenvolvimento desse projeto encontramos diversos pontos fracos que certamente serão
                        reforçados em atividades futuras. Nós acreditamos que não há problema algum em cometer erros,
                        desde que eles sejam usados como degraus para o progresso.
                    </p>
                    <p className="p1">

                    </p>
                </div>
            </div>
        </div>
    );
};

export default Overview;
